listProblem.detailsInfo:
Reports any methods that do not require a class instance creation and can be
made static.

**Example:**

```
class MyClass(object):
    def my_method(self, x):
        print(x)
```

If a **Make function from method** quick-fix is applied, the code changes to:

```
def my_method(x):
    print(x)


class MyClass(object):
    pass
```

If you select the **Make method static** quick-fix, the `@staticmethod` decorator is added:

```
class MyClass(object):
    @staticmethod
    def my_method(x):
        print(x)
```

